import base64

last_line = "AAATKMkCAwEAAQ=="
decoded = base64.b64decode(last_line)
print(decoded.hex())

# Base64 decode of n
n_base64 = ""

# Add padding
n_base64 += "=" * ((4 - len(n_base64) % 4) % 4)

n_bytes = base64.b64decode(n_base64)
n = int.from_bytes(n_bytes, byteorder="big")  # 'big' for big-endian byte order

print(f"n as decimal: {n}")
